class App {
    static start() {
        if (!App.debug) {
            Object.freeze(GameConstants);
        }
        Preload.load(App.debug).then(() => {
            UndergroundItem.initialize();
            App.game = new Game(new Update(), new Breeding(), new Pokeballs(), new Wallet(), new KeyItems(), new BadgeCase(BadgeCase.Badge.Elite_HoennChampion), new OakItems([20, 50, 100]), new Party(), new Shards(), new Farming(), new LogBook(), new RedeemableCodes(), new Statistics());
            Notifier.notify({ message: 'Game loaded', type: GameConstants.NotificationOption.info });
            GameController.bindToolTips();
            GameController.addKeyListeners();
            PokedexHelper.populateTypeFilters();
            PokedexHelper.updateList();
            App.game.initialize();
            ko.applyBindings(App.game);
            ko.options.deferUpdates = true;
            GameController.applyRouteBindings();
            Preload.hideSplashScreen();
            App.game.start();
        });
    }
}
