class Update {
    constructor() {
        this.saveKey = 'update';
        this.version = '0.4.2';
        this.saveVersion = '0.0.0';
    }
    isOlderVersion(version, compareVersion) {
        return compareVersion.localeCompare(version, undefined, { numeric: true }) === 1;
    }
    check() {
        let playerData;
        try {
            playerData = JSON.parse(localStorage.player);
        }
        catch (‡≤†_‡≤†) {
            playerData = { statistics: {} };
        }
        // v0.4.0 - Statistics update
        if (this.isOlderVersion(this.saveVersion, '0.4.0')) {
            try {
                const statistics = Object.assign(Object.assign({}, playerData.statistics), { pokemonCaptured: playerData._caughtAmount, pokemonDefeated: playerData._defeatedAmount, totalShinyPokemonCaptured: playerData._shinyCatches, totalPokemonCaptured: playerData.statistics.pokemonCaptured, totalPokemonDefeated: playerData.statistics.pokemonDefeated });
                App.game.statistics.fromJSON(statistics);
            }
            catch (‡≤†_‡≤†) {
                console.error('[update] v0.4.0 - Couldn\'t update statistics..');
            }
        }
        if (this.saveVersion != this.version) {
            Notifier.notify({ title: `[v${this.version}] Game has been updated!`, message: 'Check the changelog for details!', type: GameConstants.NotificationOption.primary, timeout: 6e4 });
        }
    }
    fromJSON(json) {
        if (!json) {
            return;
        }
        this.saveVersion = json.version || '0.0.0';
    }
    toJSON() {
        return {
            version: this.version,
        };
    }
}
